import React from 'react'

export default function Die(props) {
    const styles = {
        backgroundColor: props.isHeld ? '#59E391' : '',
    }
    return (
        <div className={`die-face ${props.isHeld ? "selected-die" : ""}`}>
            <h2>{props.value}</h2>
        </div>
    )
}
